import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";

import Join from "./components/Join";
import Navbar from "./components/Navbar";

const App = () => (
  <Router>
    <Route path="/" exact component={Join}></Route>
  </Router>
);

export default App;
